import React, { Component } from 'react'

class PreviousExchange extends Component {
  state = {
    rating: 0,
  }

  render() {
    return(
      <div>1 {this.props.exchange.selected_currency} = {this.props.exchange.result} {this.props.exchange.user_currency} <button onClick={this.onRateUpClick}>+</button></div>
    )
  }
}

export default PreviousExchange
